package db.domain;import java.util.Arrays;public class BackupPositionImpl implements BackupPosition {	@Key	private String uname;	@Key	private int position;	private int templetId;	private int heroId;	public BackupPositionImpl() {	}	public BackupPositionImpl(BackupPosition c) {		this.uname = c.getUname();		this.position = c.getPosition();		this.templetId = c.getTempletId();		this.heroId = c.getHeroId();	}	@Override	public String tableName() {		return "backup_position";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setPosition(int position) {		this.position = position;	}	public int getPosition() {		return this.position;	}public void addPosition(int position) {		this.position += position;}	public void setTempletId(int templetId) {		this.templetId = templetId;	}	public int getTempletId() {		return this.templetId;	}public void addTempletId(int templetId) {		this.templetId += templetId;}	public void setHeroId(int heroId) {		this.heroId = heroId;	}	public int getHeroId() {		return this.heroId;	}public void addHeroId(int heroId) {		this.heroId += heroId;}}